import React from 'react';
import  {Link}  from 'react-router-dom';
function Menu() {
    return (
        <nav className="menu">
        <ul>
          <li>
            <Link to="/" activeClassName="active">Home</Link>
          </li>
          <li>
            <Link to="/generate-letter" activeClassName="active">Generate Letter</Link>
          </li>
          <li>
            <Link to="/about-us" activeClassName="active">About Us</Link>
          </li>
          <li>
            <Link to="/contact-us" activeClassName="active">Contact Us</Link>
          </li>
          <li>
            <Link to="/donate" activeClassName="active">Donate</Link>
          </li>
        </ul>
      </nav>
    );
  }
  export default Menu;
